def printA(h,n, x, y,l):
    x+=h
    if n == 1:
        l = l + y
        while y < l:
            Ar[y][x] = 1
            y = y + 1
    elif n == 2:
        l = l + x
        while x < l:
            Ar[y][x] = 1
            x = x + 1
    elif n == 3:
        Ar[0][x]=47

