def get_answer(body):
    zero(100)
    strlen=0
    lastspace=0
    lastd=-1
    d=0
    s=0
    argn=0
    ln=len(body)
    if ln>90:
        return "C–ª–∏—à–∫–æ–º –±–æ–ª—å—à–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ(\n–ü–æ–ø—Ä–æ–±—É–π –µ–≥–æ —Ä–∞–∑–¥–µ–ª–∏—Ç—å –Ω–∞ –Ω–µ—Å–∫–æ–ª—å–∫–æ"
    while d<ln:
        w=body[d]
        if w==" ":
            if s-lastspace>84:
                zero(s)
                return "–†–∞–∑–¥–µ–ª—è–π –±–æ–ª—å—à–∏–µ —Å–ª–æ–≤–∞ –ø—Ä–æ–±–µ–ª–∞–º–∏('"+ body[lastd+1:d]+"'),—á—Ç–æ–±—ã –∏—Ö –±—ã–ª–æ –ø—Ä–æ—â–µ –æ–±—Ä–∞–±–∞—Ç—ã–≤–∞—Ç—å"
            if strlen>84:
                paint("\n",lastspace)

                strlen=s-lastspace
                lastspace = s
                s+=paint(" ",s)
            else:
                lastspace=s
                g=paint(w,s)
                s+=g
                strlen+=g
            lastd=d
        else:
            g=paint(w,s)
            s+=g
            strlen+=g
            argn+=g
        if w=="\n":
            strlen=0
            lastspace=s
            argn-=2
        d+=1
    if body[0]=='4' and body[1]=='2':
        return goprintsmall(s-2)
    ll=goprint(s)
    if argn:
        return ll
    return ""

